import React, { useState } from "react";
import { WrapperCSSTransition } from "../Wrapper/Wrapper";
import "./Tutorial.css";

interface TutorialProps {}

export const Tutorial: React.FC<TutorialProps> = (props) => {
  const [activePage, setActivePage] = useState("first-page");
  return (
    <div className="tutorial-panel">
      <CSSTransition
        in={activePage === "first-page"}
        unmountOnExit
        timeout={500}
        classNames="menu-weighted"
      >
        <div className="first-page">
          <h1>Welcome to the "Rat in a maze" Pathfinding Visulazing tool!</h1>
          <div></div>
        </div>
      </CSSTransition>
    </div>
  );
};
